import React, {Component} from 'react';


export class HomeButton extends React.Component{
    
    render(){
        return (<div>
            <a onClick = {() => this.props.updatePage("home")} id="home_button" href="/index.html">HOME</a>
        </div>);
    }
}

export default HomeButton;
